import React from 'react';
import './Addvideo.css';


class AddVideo extends React.Component{
    constructor(props){
        super(props);
        this.state={
            course:[],
            video_url:"",
            title:"",
            coverphoto:"",
            loading:false,
            coverphoto_err:"",
            name_err:""
        }
    }


    componentDidMount(){
        /*For fetching videos under a particular course
        So the the courses.id is grabbed from the course
        */
         fetch(`http://127.0.0.1:5000/add_video/${this.props.match.params.id}`,

   {
     method:"GET",


 }
 )
 .then(res=>res.json())
 .then(data=>{
     this.setState({
        course:data.course
     })


 })
 .catch(err=>console.log(err))
     }




  //For adding a topic or a video for a specific course   

     videohandler=(e)=>{
         this.setState({
             video:e.target.files[0]
         })


     }

     video_url_handler=(e)=>{
         this.setState({
             [e.target.name]:e.target.value
         })

     }

     titlehandler=(e)=>{
         this.setState({
             title:e.target.value
         })

         if(this.state.title.trim()==""){
             this.setState({
                 title_err:"Video title required"
             })
         }
     }

     addvideo(id){
         const data=new FormData();
         data.append("video",this.state.video)
         data.append("coverphoto",this.state.coverphoto)
         data.append("title",this.state.title)


         if(this.state.title.trim()==""){
             this.setState({
                 title_err:"Title of video required"
             })
         }
         else if(this.state.coverphoto==null){
             this.setState({
                 coverphoto_err:"Video coverphoto required"
             })
         }

         fetch(`http://127.0.0.1:5000/add_video/${id}`,
         {
             method:"POST",
             body:data,
             headers:{
              Authorization: `${localStorage.getItem("token")}`
          },
         }

         )
         .then(res=>res.json())
         .then(data=>{
             alert("Video uploaded")
          })
         .catch(err=>{
             console.log(err)
         })
     }





     deletevideo=(id)=>{

      fetch(`http://127.0.0.1:5000/videos_delete/${id}`,


      {
          method:"DELETE"
      }
      )
      .then(res=>res.json())
      .then(data=>{
          console.log(data.message)
          let postlist=this.state.post_comments
          for(let i=0;i<postlist.length;i++){
              let p=postlist[i]
              if(p._id===id){
                  postlist.splice(i,1)
                  break
              }
          }
          this.setState({post:postlist})
      })
      .catch(err=>{console.log(err)})



  }









     render(){
         return(
             <div className="row add-pdf-background">
        {
          this.state.course.map(t=>{
              const id={t}
              return(
                 <div style={{marginTop:100,paddingBottom:30}} className="form-container ">



                   <div style={{flexDirection:"row"}} className="col text-center">
         <h3 style={{marginTop:10,textAlign:"center",fontSize:20}}>Video title/topic</h3>
         <input   style={{width:200}} onChange={this.titlehandler} type="text" name="title" className="courseinput"/>
         </div>

                   <div style={{flexDirection:"row"}} className="col text-center">
         <h3 style={{marginTop:10,textAlign:"center",fontSize:20}}>Course Video Link/URL</h3>
         <input   style={{width:200}} onChange={this.video_url_handler} type="text" name="video_url" className="courseinput"/>
         </div>


         <div style={{flexDirection:"row"}} className="col text-center">
         <h3 style={{marginTop:10,textAlign:"center",fontSize:20}}>Video Coverphoto</h3>
         <input ref={(ref)=>{this.post_media=ref;}}   style={{width:200}} onChange={this.videocoverphotohandler} type="file" name="post_media" className="inputfile1"/>
         </div>



                  <div className="col text-center">
                  <input type="submit" value='Post' onClick={()=>this.addvideo(t.id)} style={{width:200}} className="formbutton"/>
                  </div>
                  </div>

              )


          })
        }
     </div>
         )
 }



}

export default AddVideo;
